    const fetchHasil = async () => {
        await axios
            .get(`http:localhost:8000/api/data_kematian`)
            .then(({data}) => {
                setHasil(data);
                console.log(data);
            });

    }

    useEffect(() => {
        fetchHasil();
    }, []);

